import React from "react";

class Error extends React.Component {
    constructor(props) {
        super(props);
    }
    render(){
        return (
            <div>
                <p style={{ width: '80px', height: '40px', fontSize: '30px', fontWeight: '800', margin: '20% auto' }}>404</p>
            </div>
        )
    }
}
export default Error;
